import json
import numpy as np
import logging
from typing import List

#TEMP controls how much "bottom-up" estimates (from words, the google model) influence prediction of next state
#temp 0 - 1.0: winner takes all; temp > 1.0, differences between states diminished
#TEMP: the lower the value, the more confidence we have on estiamtes based on words
TEMP = 10.0
#DECAY controls how much "top-down" estimates from current context influence prediction of next state
#decay 0-1.0: the higher the number (e.g., 0.9) the more weight top-down context has on state prediction
#DECAY: the higher the value, the more that we use current context to predict the next state (e.g., less confidence on estiamtes from words)
DECAY = 0.5
#See examples at bottom of this file


contexts = {'Decide': 0.0, 'Order': 0.0, 'Bake': 0.0, 'Payment': 0.0, 'Deliver': 0.0, 'Eat': 0.0, 'unknown': 0.0}
init_states = {'Deliver Pizza': 0.0, '$START': 0.0, 'Make Payment': 0.0, 'Order Pizza': 0.0,
               'Select Pizza': 0.0, 'Eat Pizza': 0.0, 'Make Next Delivery': 0.0, 'Bake Pizza': 0.0,
               'Schedule Order': 0.0, '$END': 0.0}

all_messages: List[List[str]] = []

