def map_context(state):
    switcher = {
        "Select Pizza": 'Decide',
        'Schedule Order': 'Order',
        'Order Pizza': 'Order',
        'Bake Pizza': 'Bake',
        'Make Payment': 'Payment',
        'Deliver Pizza': 'Deliver',
        'Make Next Delivery': 'Deliver',
        'Eat Pizza': 'Eat'
    }
    return switcher.get(state, "unknown")


def softmax(d: dict, temp: float = TEMP) -> dict:
    # d is a dict with key = state, value = score
    # convert score to prob using softmax, with temperature (-> 0 = winner take all)
    converted_prob = \
        np.exp(np.divide(list(d.values()), temp)) / np.sum(np.exp(np.divide(list(d.values()), temp)), axis=0)
    index = 0
    new = {}
    for s in d.keys():
        new[s] = converted_prob[index]
        index += 1
    return new


def update_context(prob, state, context, decay=DECAY):
    for s, v in prob.items():
        contexts[map_context(s)] += v
    if context == map_context(state):
        # same context decays over time
        contexts[map_context(state)] *= decay
    return softmax(contexts, temp=1.0)

def cal_next_state (posterior, context):
    new_posterior = softmax(posterior)
    for state in posterior:
        new_posterior[state] = new_posterior[state] * context[map_context(state)]
    new_posterior = softmax(new_posterior)
    return max(new_posterior, key=lambda i: new_posterior[i])

def run_sim(domain, input_data):
    # output are dict object from output file
    #cur_state: str = '$START'
    cur_state = input_data['cur_state']
    cur_context = ''
    state_seq = [cur_state]
    posterior = init_states
    trans = {}

    path_to_model_directory = './models/{domain}'.format(domain=domain)  # E.g., 'pizza' as domain
    prob_trans = json.loads(open('{model_dir}/contextual_transitions.json'.format(model_dir=path_to_model_directory)).read())

    logging.debug("Message = {message}".format(message=input_data))
    pred_data = input_data['predictions']
    logging.debug("Predictions = {preds}".format(preds=pred_data))
    predictions = softmax(pred_data, temp=1.0)
    logging.debug("Softmax Result: {result}".format(result=predictions))
    index = input_data.get('message_index')
    trans = prob_trans['Decide']
    for state in posterior:
        posterior[state] = predictions.get(state, 0.0) * trans[cur_state].get(state)

    contexts = update_context(posterior, cur_state, cur_context)
    cur_context = max(contexts, key=lambda k: contexts[k])
    cur_state = cal_next_state(posterior, contexts)
    state_seq.append(cur_state)

    return list(state_seq)

